import collections
from queue import LifoQueue

def dota2\_senate(starting\_ Senate):
    senate\_queue = collections.deque(starting\_Senate)
    dradant = LifoQueue()
    dradant.put('D')

    while senate\_queue:
        current = senate\_queue.popleft()
        if current == 'D':
            if not dradant.empty() and dradant.get() == 'R':
                continue
        else:
            if not dradant.empty() and dradant.get() == 'D':
                continue

        dradant.put(current)

    return 'D' if dradant.qsize() > 0 and dradant.get() == 'D' else 'R'

starting\_Senate = ['D', 'R', 'D', 'D', 'R', 'D', 'R', 'D']
print(dota2\_senate(starting\_Senate))
